df1 = pd.read_csv(StringIO('\n'.join(doc_Felipe_Loque))).set_index('Team Name')



# no idea why some teams have multiple entries, take the best score (min)

df2 = pd.read_csv(StringIO('\n'.join(raw_week2_download))).set_index(

    'TeamName').groupby(level=0)['Score'].min().to_frame()
# some names have become corrupt, fix as much as possible with a simple approach



missing_in_1 = [t for t in df2.index if t not in df1.index]

missing_in_2 = [t for t in df1.index if t not in df2.index]



def clean_txt(txt):

    return ''.join([c for c in txt if c.lower() in ' abcdefghijklmnopqrstuvwxyz'])



mapping = {i:i for i in df1.index}

for t in missing_in_1:

    candidates = []

    for t2 in missing_in_2:

        if clean_txt(t2) == clean_txt(t):

            candidates.append(t2)

    if len(candidates) == 1:

        mapping[candidates[0]] = t



df1.index = df1.index.map(mapping)
# join scores

# focus on scores below 0.03

# filter teams that did better on the public lb (indicating overfit)

# plot to check



df = df1.join(df2).rename({

    'Score Public LB': 'public',

    'Score 2019-12-06': 'week1',

    'Score': 'week2'}, axis=1).dropna(subset=['public', 'week1', 'week2'])



df = df[df.week1<0.03]

df = df[~(df.week1 - df.public > 0)]



pd.plotting.scatter_matrix(df[['public', 'week1', 'week2']])

plt.show()
# predict the final leaderboard score, using public and week1 as features

# proxy-target is the week2_plays_score

# assume that week2 = (week1_plays_score + week2_plays_score) / 2

# calculate target = 2 * week2 - week1



# fit the model, and replace week1 by week2 for predicting (because week2 is a better estimate)



df['target'] = 2 * df['week2'] - df['week1']



model = LinearRegression(fit_intercept=False)

model.fit(df[['public', 'week1']], df['week2'])

print('[public, private] weights', model.coef_)



df['public_factor'] = df['public']/df['week2']

public_factor = df['public_factor'].mean()

week1_factor = (df['week1']/df['week2']).mean()

target_factor = (df['target']/df['week2']).mean()

print('public_factor', public_factor)



unmatched_teams = [team_name for team_name in df2.index if team_name not in df.index]

dfx = df2.loc[unmatched_teams].rename({'Score': 'week2'}, axis=1)

dfx['public'] = public_factor * dfx.week2



df = df.append(dfx, sort=True)



df['week2_c'] = df['week2'] * week1_factor



df['final_score'] = model.predict(df[['public', 'week2_c']]) / target_factor

df.sort_values(by='final_score', inplace=True)

df['final_rank'] = np.arange(1, len(df)+1)



df.loc[unmatched_teams, 'public'] = np.nan



